import React,{ useState } from 'react';
import SelectAutoWidth from '../../Components/Select';
import BasicDatePicker from'../../Components/Data'
import { TextField } from '@mui/material';
import { Button } from '@mui/material';
import { FormHelperText } from '@mui/material';
import './style.css'
import { maxWidth } from '@mui/system';


// import { Container } from './styles';

const FormCadastro =()=> {

    const[ nRegistro,
      usuDoCadastro,
      codSituacao,
      statu,
      datadoCadastro,
      cod,
      coligada,
      codFilial,
      filial,
      setor,
      idPessoa,
      matricula,
      nomeCompleto,
      email,
      senha ] = useState('')
    
    const handleInputChange=(evento)=>{
      
      console.log(evento.target.value);
    
  }




  
  return (
      <>
      
      <div className='container'>
        <h2 className='tituloCad'>Cadastro de solicitação</h2>
        <div className='div0' >
          <TextField onChange={handleInputChange} sx={{ m:1}} id="outlined-basic" label="Matrícula" variant="outlined" />
          <TextField onChange={handleInputChange}sx={{ m:1}}id="outlined-basic" label="Solicitante" variant="outlined" />
          <TextField onChange={handleInputChange}sx={{ m:1}}id="outlined-basic" label="Filial" variant="outlined" />
          <BasicDatePicker className='data'/>
        </div>
        <div className='div1'>
        <TextField onChange={handleInputChange} sx={{ m:1}} id="outlined-basic" label="Setor" variant="outlined" />
          <TextField onChange={handleInputChange}sx={{ m:1}}id="outlined-basic" label="Loja" variant="outlined" />
          <TextField onChange={handleInputChange}sx={{ m:1}}id="outlined-basic" label="Contato" variant="outlined" />
        </div>
        <div className="div2">
          <TextField sx={{ m: 1, minWidth: '100%'}}id="outlined-multiline-static"  label="Observação" placeholder="Digite alguma observação sobre a solicitação" multiline rows={4} defaultValue="Default Value"/>
        </div>
       
        
        
      </div>


      </>
  );
  
}

export default FormCadastro;
